import React, { Fragment } from "react";
import Translations from '../resources/Translations.js';

const CreatePoll = () => {

    const style = {
        marginTop: '40px',
        marginLeft: '60px'
    }

    const textStyle = {
        width: '700px'
    }

    return ( 
      
    <Fragment >
        <div style={style}>
            <h2>{Translations['createNewPoll']}</h2>
        </div>
        
      <div className="form-group" style={style}>
        <label htmlFor="example1">{Translations['pollName']}</label>
        <input style={textStyle} type="text" id="example1" className="form-control form-control-lg" />
      </div>

      <div className="form-group" style={style}>
        <label htmlFor="example1">{Translations['pollDescription']}</label>
        <textarea style={textStyle} type="text" id="example1" className="form-control form-control-lg" />
      </div>

      <div className="form-group" style={style}>
        <label htmlFor="example1">Large input</label>
        <input style={textStyle} type="text" id="example1" className="form-control form-control-lg" />
      </div>
 
    </Fragment>
    
    )
}

export default CreatePoll
